import React, { useContext } from 'react';
import AuthContext from './authContext';


function Profile() {
    const {token} = useContext(AuthContext);
    if (!token) return <UnauthorizedMessage />;

    return (
        <div>
            <h2>USER PROFILE</h2>
        </div>
    )
}

export default Profile;
